import React, { Component } from "react";
import MyTabPanel from "../components/MyTabPanel";
import NewNoteForm from "../components/NewNoteForm";

class App extends Component {
  constructor() {
    super();
    this.state = {
      showComponent: false,
    };
    this.onClickNewNote = this.onClickNewNote.bind(this);
  }

  onClickNewNote() {
    this.setState({
      showComponent: true,
    });
  }

  render() {
    return (
      <div className="container">
        <MyTabPanel />
        <NewNoteForm />
      </div>
    );
  }
}

export default App;
